					timestamp: "2023-11-05 11:16:56.750",
					ask_socfortress_message:
						"The SIGMA alert \"Process Explorer Driver Creation By Non-Sysinternals Binary\" suggests that a non-Sysinternals binary has attempted to create a Process Explorer driver on a Windows endpoint. Process Explorer is a widely used system monitoring tool developed by Sysinternals (now part of Microsoft). The creation of a Process Explorer driver by a non-Sysinternals binary could indicate suspicious or potentially malicious activity.\n\nTo investigate this alert and determine an appropriate response, you should focus on the following key aspects:\n\n1. Validate the Alert: Verify the accuracy of the alert by checking if it was triggered by legitimate activity or if it is a false positive. Ensure that your detection system is properly configured and up to date.\n\n2. Identify the Binary: Determine which specific binary attempted to create the Process Explorer driver. Look for any unusual or suspicious characteristics such as unfamiliar names, file paths, digital signatures, or hash values.\n\n3. Analyze Process Execution Context: Investigate the context in which the binary executed and attempted to create the driver. Review process execution details, such as parent processes, command-line arguments, process creation time, and associated network connections.\n\n4. Assess System Impact: Evaluate whether any abnormal behavior occurred on the endpoint after this event took place. Look for signs of system instability, crashes, performance degradation, or other anomalous activities that may indicate malicious intent.\n\n5. Conduct File Analysis: Perform an in-depth analysis of the binary itself using appropriate tools like antivirus scanners and sandboxing environments to identify any malware indicators such as malicious code patterns or known signatures associated with malware families.\n\n6. Check Reputation: Research information about the binary's reputation online using threat intelligence platforms, virus total scanners, or security forums to determine if it has been previously identified as malicious.\n\n7. Perform Behavioral Analysis: If feasible, conduct dynamic analysis by executing the binary in an isolated environment while monitoring its behavior for any suspicious activities like network communication, file system changes, or attempts to escalate privileges.\n\n8. Review System Logs: Examine relevant logs such as event logs, process creation logs, driver loading logs, and network logs to identify any additional indicators of compromise or related activities.\n\nWhen assessing this alert, you should also ask yourself the following additional questions:\n\n1. Is the binary a legitimate tool that is commonly used in your organization? If not, why would it be present on the endpoint?\n\n2. Is there a business justification for creating a Process Explorer driver with this specific binary? Are there any documented cases or known legitimate reasons for doing so?\n\n3. Are there any other security events or alerts related to this binary or associated processes that can provide further context?\n\n4. Has the binary been whitelisted or approved by your organization's security policies? If not, why was it allowed to execute on the endpoint?\n\n5. Do you have sufficient visibility into other endpoints within your environment? Have similar events been observed elsewhere? This could indicate a larger-scale attack.\n\nRemember that each investigation may vary based on your organization's specific context and requirements.",
