					ask_socfortress_message:
						"The SIGMA alert \"Process Explorer Driver Creation By Non-Sysinternals Binary\" indicates that a Windows endpoint has detected an instance where a process explorer driver was created by a binary that is not associated with Microsoft Sysinternals, a legitimate software tool widely used for system monitoring and troubleshooting.\n\nThis alert suggests the possibility of malicious activity on the endpoint. Attackers often leverage process explorer drivers or similar techniques to gain unauthorized access, elevate privileges, or hide their presence on a system. As such, it is important to thoroughly investigate this alert to determine the appropriate response.\n\nHere are key aspects you should investigate when responding to this alert:\n\n1. Endpoint Details: Gather information about the affected endpoint such as its hostname, IP address, operating system version, and any other relevant details. This information will help in understanding the context and potential impact of the alert.\n\n2. Timestamp and Correlation: Identify when the event occurred and check for any correlation with other security events or alerts on the same endpoint or across your environment. This can help determine if it's an isolated incident or part of a broader attack pattern.\n\n3. Process Explorer Driver: Determine which specific driver was created and by which binary it was created. Identify its location on disk and inspect its file properties (e.g., name, size, creation date). Compare these details against known legitimate drivers associated with Microsoft Sysinternals tools.\n\n4. Binary Analysis: Conduct further analysis of the non-Sysinternals binary responsible for creating the process explorer driver. Scan it using antivirus/anti-malware tools to identify any potential malicious behavior or indicators of compromise (IOCs). Consider submitting samples to threat intelligence platforms for additional analysis.\n\n5. Process Information: Examine details about the process associated with creating this driver (e.g., process ID (PID), parent PID) to understand how it was initiated and by what means.\n\n6. System Logs: Review relevant logs such as event logs, system logs, and security logs to identify any suspicious activities or additional indicators of compromise. Look for any abnormal system behavior or unauthorized modifications.\n\n7. User Context: Determine the user account associated with the process that initiated the driver creation. Check if it is a privileged account or a standard user account. If it is a privileged account, investigate whether this activity was expected and authorized.\n\n8. Network Activity: Analyze network traffic logs to identify any communication originating from the affected endpoint during or after the event. Look for connections to suspicious IP addresses, domains, or known command-and-control servers.\n\n9. Endpoint Security Posture: Evaluate the security controls deployed on the affected endpoint, such as antivirus/anti-malware software, intrusion prevention systems (IPS), host-based firewalls, and endpoint detection and response (EDR) solutions. Determine if these controls detected or blocked any malicious activity related to this alert.\n\n10. Incident Response Plan: Assess your organization's incident response plan and determine if there are predefined steps for responding to similar alerts like this one. Follow established procedures to contain the incident, mitigate risks, remediate affected systems, and prevent future occurrences.\n\nAdditional questions you should ask yourself when assessing this alert:\n\n1. Is there any legitimate reason for a non-Sysinternals binary to create a process explorer driver on this endpoint?\n2. Have there been any recent changes in software deployment or system configuration that could explain this alert?\n3. Are there other endpoints in your environment running similar binaries that could trigger similar alerts?\n4. Are there any recent reports of malware campaigns targeting process explorer drivers or abusing legitimate tools like Sysinternals?\n5. Are there any indicators suggesting compromise on this endpoint beyond just the creation of the driver?\n\nBy thoroughly investigating these aspects and considering additional relevant questions specific to your environment, you can make an informed decision about how best to respond to this SIGMA alert and mitigate potential risks.",
